rl.prototype.c=function(){sl=this;this.Yc="Welcome to the Cognitive Quest. The game is designed to train your cognitive skills such as memory, attention and thinking. Your task is to pass all the stages and defeat the final boss. To move to the next stage you need to find and defeat the boss of the stage. To navigate through the stage [[You can use the arrow keys or 2,4,6,8 keys or clicking the mouse on passages|touch the passage]]. You can open the help screen using button with question mark in the lower right corner of the screen. The game is saved automatically.";this.fa=
"To interact with what is in the room, [[use the key 5 (0 - close) or the spacebar or click the mouse|touch this]]. You can buy various items from the merchant. Health Potion - fully restores health (used automatically). Key - opens the chest. Ruby - if you collect 5 pieces, it will increase the maximum health. New weapons - increases normal and critical damage (percentage of glowing sword). Map will help you navigate at the stage, will be displayed in the top right corner. Only 5x5 part is visible on the large stages.";
this.nc="In order to dispel smoke blocking the path, you must defeat the one who is in the room. The battle consists of answers to questions, [[you can use key 5 or space to start, response can be entered from the keyboard or by clicking on the blue buttons|for answer use the number buttons on the edges of the screen]]. If you answer correctly you inflict damage to the enemy. If you do not have enough time to answer, you will get normal damage; if you make a mistake, you will get critical damage. You are given two time intervals for the answer. If you have time to answer only at the second interval (when the scale is blinking), then you'll be able to strike the enemy, but the enemy will riposte you, the faster you answer the less riposte damage you get, the maximum value of such damage is 50% of normal. Important! Fatal damage to the enemy can be applied only in the first interval. You just can not be killed by riposte. You can practice before the battle.";
this.Hh="You get gold and experience after victory. The enemy gets experience too (pink scale). With the defeat, you lose a star, less stars, less reward. With the reduction of the stars the enemy's parameters decrease. An additional award is given for 1)Improve - your average speed of answer is less than it was before 2) Series of victories, a few victories in a row with 5 stars. The game has about 20 kinds of exercises that will be opened when you pass it. Just after the passage of a new exercise it becomes available in the section of practice (on the start screen), where you can practice without a time limit.";
this.Gh="If you have enough time to reply during the first time interval (until the scale does not end at the first time), it will cause normal damage of the enemy, if you reply twice in a row at the first period, then it will cause critical damage of the enemy (percentage of glowing sword). Three spheres will appear under the time scale in some exercises. Then you need to answer three times before you hit the enemy.\nIf possible always try to have a health potion with you.";this.Yb="Battle with the boss is serial passage of a few exercises. Teleport to the next stage will be opened for you after victory. The battles are designed so that you cannot lose if you don't make a mistake and answer on time, because riposte cannot kill you. Therefore, if you have any difficulties with the battle try to respond more slowly and don't make a mistake.  ";
this.$c="Once teleport is opened, you can always go to the next stage. If you defeat everyone at the stage, you'll get extra gold. You can open help screen with the button in the lower right corner.";C();var a=D(E(),F(n(z(r),[this.Yc,this.fa,this.nc,this.Hh,this.Gh,this.Yb,this.$c])));this.ca=cc(a);return this};rl.prototype.a=new v({cG:0},!1,"brainquest.common.TutorTxt$",x,{cG:1,b:1});var sl=void 0;function tl(){sl||(sl=(new rl).c());return sl}
